import React from 'react';

const taskWrapperStyle = {
    backgroundColor: "#ffffce",
    height: "20px",
    width: "30%",
    margin: "10px auto",
    border: "4px solid #fcfcb0",
}

class Task extends React.Component {

    render() {
        return (
            <div style={taskWrapperStyle}> </div>
        );
    }
}

export default Task;
